func TestParsePlaybackTrack(t *testing.T) {
	db,_ := NewFr24(nil)
	
	f,err := db.ParsePlaybackTrack(playbackFullJSON)
	if err != nil {
		t.Errorf("ParsePlayback full; err=%v", err)
	}

	expected := "VRD746[Sep08:SAN-SFO]  fr24 Track: 212 points, start=2015.09.08 21:19:12, 1h18m53s, 720.6KM (320 deg), src=fr24"
	if fmt.Sprintf("%s",f) != expected {
		t.Errorf("ParsePlayback didn't stringify right\nWanted:'%s';\ngot   :'%s'", expected, f)
	}
}

