func TestParseCurrentList(t *testing.T) {
	db,_ := NewFr24(nil)
	f,err := db.ParseCurrentList(listJSON)

	if err != nil {
		t.Errorf("ParseList; err=%v", err)
	} else {
		expected := "UA1179[Sep10:SFO-LAS] @ [2015-09-10 15:55:24 +0000 UTC] (37.5117,-122.4595) 11461ft, 212kts"
		if f[0].String() != expected {
			t.Errorf("ParseList: first entry not as expected.\nExpected: %s\nActual  : %s\n", expected, f[0].String())
		}
	}
}

